import {useContext, useEffect} from "react";
import Navbar from "./comps/navbar";
import { EnvContext } from "./comps/contexts/envContext";

const Index = () => {

    const {statusUrl}  = useContext(EnvContext)

    useEffect(() => { console.log(statusUrl) },[statusUrl])

    return (
        <div>
            <Navbar/>
           <h1>Hello from index</h1> 
           <h3>{statusUrl}</h3>
        </div>

    )
}

export default Index;
